      SELECT DISTINCT - - col0 * + - 15 * + - 49 * col0, col1 FROM tab1 (FORMAT parquet) WHERE NOT - + ( col1 ) NOT BETWEEN + + col1 AND + col1 * 36;
  - name: tab1

outputs:
  - name: q12432.out
    data: |
